import React from 'react';
import Col from "react-bootstrap/Col";
import InputGroup from 'react-bootstrap/InputGroup';
import Image from "react-bootstrap/Image";
import Form from "react-bootstrap/Form";
import Row from "react-bootstrap/Row";

const MySelector = ({ img, item}) => (
                                    <Col sm={5} >
                                        <InputGroup style={{height: '45px'}}>
                                            <InputGroup.Prepend>
                                                <Image alt=''
                                                       src={img}
                                                       style={{pointerEvents: 'none'}}/>
                                            </InputGroup.Prepend>
                                            <Form.Control style={{height: '45px'}} as="select">
                                                {item.map((val,key) =>{
                                                    return <option key={key}>{val}</option>
                                                })}

                                            </Form.Control>
                                        </InputGroup>
   <Col md={5}>
                                        <Form.Group controlId="formBasicChecbox">
                                            <Form.Check type="checkbox"
                                                        label={this.state.isCheckClick ? "Per-hour booking for" : "Per-hour booking"}
                                                        onChange={() => this.setState({isCheckClick: !this.state.isCheckClick})}/>
                                        </Form.Group>
                                    </Col>
                                    </Col>
);
export default MySelector;
